const BarChart = () => {

    const [people, getPeople] = useState([{}]);
    useEffect(()=>{
      fetch('http://localhost:3001/data')
      .then(res => res.json())
      .then(data => {
        getPeople(data);
      })
    },[]);
  
    console.log(people);
     
    return (
        <div>
            <h1>Bar Chart</h1>
            
        </div>
    )
}

export default BarChart;
